from Crypto.Hash import SHA256
from Crypto.Protocol.KDF import scrypt
from Crypto.Cipher import AES


ans = ""

def generate_key_from_password(password):
    return scrypt(
        password,
        '', # Salt (empty)
        16, # Key length
        N=2**14,
        r=8,
        p=1
    )
print(generate_key_from_password(ans))